import React from 'react';
import './App.scss';
import Dashboard from './containers/Dashboard';
import { Router, Switch, Route } from 'react-router-dom';

const App: React.FC = () => {
  return (
    <div>
      <Switch>
        <Route exact path="/">
          <Dashboard />
        </Route>
      </Switch>
    </div>
  );
};

export default App;
